import React from 'react';

export default function MovieForm(props) {

  let { movie } = props;

  return (
    <React.Fragment>
      {
        movie ? (
          <fieldset>
            <label htmlFor="inputTitle">Title</label>
            <input 
              type="text" 
              placeholder="Title" 
              name="inputTitle" 
              id="inputTitle"
            />
            <label htmlFor="">Description</label>
            <input
              type="text"
              placeholder="Description"
              name="inputDescription"
              id=""
            />
          </fieldset>
        ) : null
      }
    </React.Fragment>
  );
};
